import React from "react";
import Card from "./Card";
import contacts from "../contacts";

function App(props) {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      <Card 
        name= {Contact.name}
        img= {Contact.imgURL}
        phone= {Contact.phone}
        email= {Contact.email}
      />
    </div>
  );
}

export default App;
